import sympy
def prime3_finder():
  outVec = []
  power = 2
  for n in range(100,999999999):
      if not n & 3 == 3: continue # speed-up over simple MOD operation
      if not n % 10**power == 3: continue
      if not sympy.isprime(n): continue
      outVec.append(n)
      power += 1
  return outVec
